static int getpos(unsigned short uni){
	int s = 0, e = sizeof(R)/sizeof(R[0])/3-1,m;
	while(s<=e){
		m = (s+e)/2;
	  if(R[m*3] <= uni) s = m+1;
	  else e=m-1;
	}
    if(e>=0 && uni >= R[e*3] && uni <= R[e*3+1])
        return R[e*3+2] + uni - R[e*3];
    return -1;
}

int unicode2gbk(const void *sunicode, int len, char outgbk[]){
	const unsigned short *unicode = sunicode;
	int i, pos = 0;
	unsigned short uni,gbk,vpos;
	for(i=0;i<len;i++){
		uni = unicode[i];
		if(uni < 0x80)
			outgbk[pos++] = uni;
		else{
			vpos = getpos(uni);
			if(vpos >= 0){
				gbk = T[vpos];
				outgbk[pos++] = gbk;
				outgbk[pos++] = gbk>>8;
			}
		}
	}
	outgbk[pos] = 0;
	return pos;
}

